    true,nt"url": null,nt"notes": "The Carbon Dioxide Information Analysis
    Center (CDIAC) is the primary climate-change data and information analysis center
    of the U.S. Department of Energy (DOE). CDIAC is located at DOE's Oak Ridge National
    Laboratory (ORNL) and includes the World Data Center for Atmospheric Trace Gases.
     CDIAC's data holdings include estimates of carbon dioxide emissions from fossil-fuel
    consumption and land-use changes; records of atmospheric concentrations of carbon
    dioxide and other radiatively active trace gases; carbon cycle and terrestrial carbon
    management datasets and analyses; and global/regional climate data and time series.
    CDIAC provides scientific and data management support for projects sponsored by
    a number of agencies, including the AmeriFlux Network, continuous observations of
    ecosystem level exchanges of CO2, water, energy and momentum at different time scales
    for sites in the Americas; the Ocean CO2 Data Program of CO2 measurements taken
    aboard ocean research vessels; DOE-supported FACE experiments, which evaluate plant
    and ecosystem response to elevated CO2 concentrations; and the HIPPO project, which
    is analyzing the atmospheric carbon cycle and greenhouse gas concentrations from
    pole to pole over the Pacific Ocean.",nt"license_title": "Creative Commons
